import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div class="ui5-rating-indicator-root" role="slider" aria-roledescription="${ifDefined(context._ariaRoleDescription)}" aria-valuemin="0" aria-valuenow="${ifDefined(context.value)}" aria-valuemax="${ifDefined(context.max)}" aria-orientation="horizontal" aria-disabled="${ifDefined(context._ariaDisabled)}" aria-readonly="${ifDefined(context.ariaReadonly)}" tabindex="${ifDefined(context.tabIndex)}" @focusin="${context._onfocusin}" @focusout="${context._onfocusout}" @click="${context._onclick}" @keydown="${context._onkeydown}" title="${ifDefined(context.tooltip)}" aria-label="${ifDefined(context.accessibleName)}"><div class="ui5-rating-indicator-stars-wrapper">${ repeat(context._stars, (item, index) => item._id || index, (item, index) => block1(item, index, context)) }</div></div>`; };
const block1 = (item, index, context) => { return html`${ item.selected ? block2(item, index, context) : block3(item, index, context) }`; };
const block2 = (item, index, context) => { return html`<div class="ui5-rating-indicator-icon ui5-rating-indicator-active-icon" data-value="${ifDefined(item.index)}">&#9733;</div>`; };
const block3 = (item, index, context) => { return html`${ item.halfStar ? block4(item, index, context) : block5(item, index, context) }`; };
const block4 = (item, index, context) => { return html`<div class="ui5-rating-indicator-icon ui5-rating-indicator-half-icon" data-value="${ifDefined(item.index)}">&#9734;</div>`; };
const block5 = (item, index, context) => { return html`<div class="ui5-rating-indicator-icon" data-value="${ifDefined(item.index)}">&#9734;</div>`; };


	return block0(context);
};

export default main;
